webpackJsonp([0x9cb078a90bc5],{5373:function(e,t){e.exports={data:{post:{html:'<p>It\'s 6:30... <i>and Christopher is still asleep!</i></p>\n<p>Andrea <a href="http://shanson.editthispage.com/discuss/msgReader$773">reminisces</a> about Legos and the Lego Train <i>(Eisenbahn)</i>. Christopher inherited a mixed box full of <a href="http://www.lego.com/legofinder/duplo.asp">Duplos</a> from his cousins, so he has several train cars (but no track), plus a couple of race cars, and some farm implements that he can hook together into a long train of sorts (with a race car in the front and a plow in the back). And aren\'t <a href="http://mindstorms.lego.com">Lego Mindstorms</a> really for adults who still want to play with Legos?</p>\n<p>Here <a href="http://www.curry.com/2001/10/31#rockOfAges">Adam Curry links</a> to me, and I <a href="/2001/10/30">got the name of the club wrong</a>. But it\'s fixed now.</p>',fields:{title:"Get 'Em Next Time",date:"31 Oct 2001",url:"https://papascott.de/2001-10-31-get-em-next-time/"}}},pathContext:{slug:"/2001-10-31-get-em-next-time/",prev:{fields:{title:"Lego Man",date:"30 Oct 2001",slug:"/2001-10-30-lego-man/"}},next:{fields:{title:"Tied Up",date:"01 Nov 2001",slug:"/2001-11-01-tied-up/"}}}}}});
